import TodoRoWItem from "./TodoRowItem"
function TodoTable(props){
    return(
        <table className="table table-hover">

            <thead>
                <tr>
                    <th scope="col">#</th>
                    <th scope="col">Description</th>
                    <th scope="col">Assigned</th>
                </tr>
            </thead>

            <tbody>

            <TodoRoWItem
                rowNumber={props.todos[0].rowNumber}
                rowDescription={todos[0].rowDescription}
                rowAssign={todos[0].rowAssign}
              />

              <TodoRoWItem
                rowNumber={todos[1].rowNumber}
                rowDescription={todos[1].rowDescription}
                rowAssign={todos[1].rowAssign}
              />

              <TodoRoWItem
                rowNumber={todos[2].rowNumber}
                rowDescription={todos[2].rowDescription}
                rowAssign={todos[2].rowAssign}
              />

            </tbody>

        </table>
    )
}

export default TodoTable
